exports=async function(bid,options){const{parseCatalog,cleanCatalogWrapper}=await require("transcode/parse_catalog"),url=`https://www.qishuta.net/du/${bid.idPrefix()}/${bid}/`;return parseCatalog(url,{cleaner:html=>cleanCatalogWrapper(html,/class="pc_list">\s*<p[^>]*>[^<]+正文<\/p>\s*<ul>/,"</ul>"),recordRegex:/href="(?<url>[^"]+)">(?<name>[^<]+)</g},{clientOptions:{...(options&&options.clientOptions)}})};